import styled from 'styled-components';

export const Container = styled.div`

    max-width: 1000px;
    margin: 0 auto;

    padding: 1rem 1rem;
    display: flex;
    flex-direction: column;
    align-items: center;

    >a{
        align-self: flex-end;
        padding: 1rem 8rem;
    }


`
